import React from 'react'
import cloudy from './img/cloudy.jpg';
import TextField from '@mui/material/TextField';


const WeatherApp = () => {
    return (
        // <div className="WeatherAppDiv" >
        //     <h1 className="myAppHeading">My Weather App</h1>
        //     <center>
        //         {/* <input placeholder="Enter your country/city ..." className="inputField" /> */}
        //         <h1 className="countryName">Karachi</h1>
        //         <TextField id="standard-basic" label="Standard" variant="standard" className="inputField" />

        //     </center>
        // </div>


        <div className="main-div">
            <h1>My Weather App </h1>
            <center>
                <div className="inputs-and-buttons">
                    <TextField  className="input-field" id="standard-basic" label="Enter your country/city . . ." variant="standard" />
                </div>
            </center>
        </div>

    )
}

// style={{ backgroundImage: `url(${cloudy})` }}

export default WeatherApp
